bool timerRunning = false;

void setup(void)
{
	// put your setup code here, to run once:
	pinMode(sensorInfrared_PushButton_PIN_D2, INPUT_PULLUP);

	lcd.begin(16, 2); // Initialize the LCD with 16 columns and 2 rows
