Pilha;

Pilha init_Pilha ( void )
{
     Pilha pilha;
     pilha . topo = VAZIA;

     return pilha;
}

void new_Pilha ( Pilha * pilha ) { pilha -> topo = VAZIA; }

void push ( Pilha * pilha , int valor )
{
    if ( pilha -> topo == CHEIA )
    {
      printf ( "- A pilha est√° cheia!\n" );
      return;   
    }

    pilha -> vetor [ ++ pilha -> topo ] = valor;
    printf ( "- Adicionado no √≠ndice da pilha %d o valor [ %d ]\n" , pilha -> topo , pilha -> vetor [ pilha -> topo ] );
}

void pop ( Pilha * pilha )
{
    if ( pilha -> topo == VAZIA )
    {
      printf ( "- A pilha est√° vazia!\n" );
      return;  
    }

    printf ( "- Removido do √≠ndice %d da pilha o valor [ %d ]\n" , pilha -> topo , pilha -> vetor [ pilha -> topo ] );
